import React from 'react';

const VideoListItem=props=>{
  const viedoData={
    title:props.snippet.title,
    img:props.snippet.thumnail.default.url,
    channel:props.snippet.chanelTitle
  };

  const videos=props.videos.map( video=>
    (
     <div>
       <li onClick={()=>video.onVideoSelect(props)}>
         <img src={viedoData.img} alt={viedoData.title}/>
         <div>
          <span>{viedoData.title}</span> 
          <small>{viedoData.channel}</small>
         </div>
       </li>
     </div>
    )
    )
  return(
    {videos}
  )

}
export default VideoListItem;
